import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import ChatApp from './components/ChatApp';
import './index.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" element={<ChatApp />} />
          <Route path="/chat/:conversationId?" element={<ChatApp />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
